import React from 'react'
import './info.scss'
import MyTitle from '../../../MyTitle/MyTitle'

const Info = () => {
  return (
    <div>
      <MyTitle fontSize='24px' lineHeight='33px' letterSpacing='0.03em'>
        My data
      </MyTitle>
    </div>
  )
}

export default Info
